  false,\n\t\"url\": null,\n\t\"notes\": \"OUTDATED. See similar current data at https://data.cityofchicago.org/d/eqdx-4qxd
  -- The lobbyist categorized expenditures report is part of the Lobbyist Activity
  Report, a notarized disclosure that must be filed twice each year (January 20th
  and July 20th). Lobbyists are required to report  the total amount of lobbying-related
  expenditures paid by the lobbyist or charged to the client in each of the categories
  listed on Form C, Part 3 of 3, Section H, Question 3 (http://bit.ly/q2lRTh). All
  lobbyist activity reports are submitted to the Board of Ethics in paper form and
  are available in their entirety in the Board's offices. The Board has, since 2000,
  compiled and posted static lists of all lobbyists and their clients online. / Data
  Owner: Board of Ethics [http://j.mp/mbH9BN] / Time Period: January 1, 2011 to present/
